let input = ''

// input = 'dabAcCaCBAcCcaDA'

function isUppercase(a) {
  return a === a.toUpperCase()
}
function matching(a, b) {
  return ((isUppercase(a) && !isUppercase(b)) || (isUppercase(b) && !isUppercase(a))) && a.toUpperCase() === b.toUpperCase()
}

const timings = {
  a: 0,
  b: 0,
  c: 0,
  d: 0,
  e: 0,
  f: 0,
  g: 0,
  h: 0,
  i: 0,
  j: 0,
  k: 0,
  l: 0,
  m: 0,
  n: 0,
  o: 0,
  p: 0,
  q: 0,
  r: 0,
  s: 0,
  t: 0,
  u: 0,
  v: 0,
  w: 0,
  x: 0,
  y: 0,
  z: 0
}
Object.keys(timings).forEach(key => {
  let answer = input.split('')
  answer = answer.filter(char => char !== key && char !== key.toUpperCase())
  for (let i = 0; i < 2; i++) {
    for (let j = 0; j < answer.length - 1; j++) {
      if (matching(answer[j], answer[j+1])) {
        answer.splice(j, 2)
        j = j < 2 ? 0 : j - 2
      }
    }
  }
  timings[key] = answer.join('').length
  console.log(answer.join(''))
  console.log(answer.join('').length)
})

console.log(timings)

